import './App.css';
import Customer from './components/Customer'

const customer = {
  'name': '김예원',
  'birthday': '990730',
  'gender': '여자',
  'job': '대학생'
}

function App() {
  return (
    <Customer
      name={customer.name}
      birthday={customer.birthday}
      gender={customer.gender}
      job={customer.job}
    />
  );
}

export default App;
